import { Navbar, Container, Nav } from "react-bootstrap";

const NavBar = () => {
    return (
        <div>
            <Navbar bg="">
                <Container>
                    <Navbar.Brand>CHINEMA XXI FILMS</Navbar.Brand>
                    <Nav>
                        <Nav.Link>Home</Nav.Link>
                        <Nav.Link>Daftar Film</Nav.Link>
                    </Nav>
                </Container>
            </Navbar>
        </div>
    );
}
export default NavBar;
